import React from "react";

interface Props {
  heading: string;
}

const PageHeading: React.FC<Props> = ({ heading }) => {
  return (
    <React.Fragment>
      <div className="page-heading-container">
        <h1 className="page-heading">{heading}</h1>
      </div>

      <style jsx>{`
        .page-heading-container {
          width: 100%;
          height: 400px;
        }

        .page-heading {
          margin-top: 50px;
          display: block;
          text-align: center;
        }
      `}</style>
    </React.Fragment>
  );
};

export default PageHeading;
